CREATE TABLE `hjmallind_cat` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `store_id` int(11) NOT NULL COMMENT '商城id',
  `parent_id` int(11) NOT NULL DEFAULT '0' COMMENT '上级分类id',
  `name` varchar(255) COLLATE utf8mb4_general_ci NOT NULL COMMENT '分类名称',
  `pic_url` longtext COLLATE utf8mb4_general_ci NOT NULL COMMENT '分类图片url',
  `sort` int(11) NOT NULL DEFAULT '100' COMMENT '排序，升序',
  `addtime` int(11) NOT NULL DEFAULT '0',
  `is_delete` smallint(1) NOT NULL DEFAULT '0',
  `big_pic_url` longtext COLLATE utf8mb4_general_ci COMMENT '分类大图',
  `advert_pic` longtext COLLATE utf8mb4_general_ci COMMENT '广告图片',
  `advert_url` longtext COLLATE utf8mb4_general_ci COMMENT '广告链接',
  `is_show` smallint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否显示【1=> 显示，2=> 隐藏】',
  `is_search` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否加入搜索类 （0-否 1-是）',
  `individual_share` smallint(1) NOT NULL DEFAULT '0' COMMENT '是否单独分销设置：0=否，1=是',
  `share_commission_first` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '一级分销佣金比例',
  `share_commission_second` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '二级分销佣金比例',
  `share_commission_third` decimal(10,2) NOT NULL COMMENT '三级分销佣金比例',
  `share_type` int(11) NOT NULL DEFAULT '0' COMMENT '佣金配比 0--百分比 1--固定金额',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `store_id` (`store_id`) USING BTREE,
  KEY `parent_id` (`parent_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=COMPACT COMMENT='商品分类';

