-- ----------------------------
-- Table structure for hjmallind_mch
-- ----------------------------
DROP TABLE IF EXISTS `hjmallind_mch`;
CREATE TABLE `hjmallind_mch` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `store_id` int(11) NOT NULL,
  `user_id` int(11) NOT NULL,
  `cash_user_id` int(11) NOT NULL DEFAULT '0' COMMENT '首次绑定门店微信提现用户',
  `addtime` int(11) NOT NULL DEFAULT '0',
  `is_delete` tinyint(1) NOT NULL DEFAULT '0',
  `is_open` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否营业：0=否，1=是',
  `is_lock` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否被系统关闭：0=否，1=是',
  `review_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '审核状态：0=待审核，1=审核通过，2=审核不通过',
  `review_result` longtext COMMENT '审核结果',
  `review_time` int(11) NOT NULL DEFAULT '0' COMMENT '审核时间',
  `realname` varchar(255) NOT NULL,
  `tel` varchar(255) DEFAULT '',
  `name` varchar(255) NOT NULL,
  `province_id` int(11) NOT NULL,
  `city_id` int(11) NOT NULL,
  `district_id` int(11) NOT NULL,
  `address` varchar(1000) NOT NULL,
  `mch_common_cat_id` int(11) DEFAULT '0' COMMENT '所售类目',
  `service_tel` varchar(1000) NOT NULL COMMENT '客服电话',
  `logo` longtext COMMENT 'logo',
  `header_bg` longtext COMMENT '背景图',
  `transfer_rate` int(11) NOT NULL DEFAULT '0' COMMENT '商户手续费',
  `account_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商户余额',
  `sort` int(11) NOT NULL DEFAULT '1000' COMMENT '排序：升序',
  `wechat_name` varchar(255) DEFAULT '' COMMENT '微信号',
  `is_recommend` int(11) NOT NULL DEFAULT '1' COMMENT '好店推荐：0.不推荐|1.推荐',
  `longitude` varchar(255) NOT NULL DEFAULT '0' COMMENT '经度',
  `latitude` varchar(255) NOT NULL DEFAULT '0' COMMENT '纬度',
  `main_content` varchar(255) NOT NULL DEFAULT '' COMMENT '主营范围',
  `summary` varchar(255) DEFAULT '',
  `score` int(11) DEFAULT '5' COMMENT '评分 1~5',
  `shop_time` varchar(255) DEFAULT NULL COMMENT '营业时间',
  `is_default` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否设为单商户主门店 0--否 1--是 （单商户只能设置一个门店为主门店）',
  `is_store` tinyint(1) NOT NULL DEFAULT '0' COMMENT '商城进入是否是默认门店 （0-否 1-是）',
  `business_type_text` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '经营模式',
  `code` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '门店编码',
  `province` varchar(255) NOT NULL DEFAULT '' COMMENT '省名称',
  `city` varchar(255) NOT NULL DEFAULT '' COMMENT '市名称',
  `district` varchar(255) NOT NULL DEFAULT '' COMMENT '区名称',
  `account_id` int(11) NOT NULL DEFAULT '0' COMMENT '一小时系统 账户id',
  `account_shop_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '一小时对接账户余额',
  `account_shop_id` int(11) NOT NULL DEFAULT '0' COMMENT '一小时系统门店id',
  `account_shop_province_id` int(11) NOT NULL DEFAULT '0' COMMENT '一小时系统门店省id',
  `account_shop_city_id` int(11) NOT NULL DEFAULT '0' COMMENT '一小时系统门店市id',
  `account_shop_area_id` int(11) NOT NULL DEFAULT '0' COMMENT '一小时系统门店区id',
  `update_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`) USING BTREE,
  KEY `user_id` (`user_id`) USING BTREE COMMENT '本系统用户id',
  KEY `account_id` (`account_id`) USING BTREE COMMENT '一小时系统账户id',
  KEY `id` (`id`) USING BTREE COMMENT '本系统门店id',
  KEY `account_shop_id` (`account_shop_id`) USING BTREE COMMENT '一小时系统门店id',
  KEY `account_shop_province_id` (`account_shop_province_id`) USING BTREE,
  KEY `account_shop_city_id` (`account_shop_city_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=946 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='商户';

