  `is_attr` int(11) DEFAULT '0' COMMENT '是否打印规格 0--不打印 1--打印',
  `big` int(11) DEFAULT '1' COMMENT '发大倍数',
  `mch_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属商户id',
