  `update_time` int(11) NOT NULL DEFAULT '0',
  `attr` varchar(255) DEFAULT '' COMMENT '规格',
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '0关闭 1开启',
  `is_delete` int(11) NOT NULL DEFAULT '0' COMMENT '1删除',
