-- Table structure for hjmallind_topic_favorite
-- ----------------------------
DROP TABLE IF EXISTS `hjmallind_topic_favorite`;
CREATE TABLE `hjmallind_topic_favorite` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `store_id` int(11) NOT NULL DEFAULT '0',
  `user_id` int(11) NOT NULL DEFAULT '0',
  `topic_id` int(11) NOT NULL DEFAULT '0',
  `addtime` int(11) NOT NULL DEFAULT '0',
  `is_delete` smallint(6) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='用户收藏的专题';

-- ----------------------------
-- Records of hjmallind_topic_favorite
-- ----------------------------

-- ----------------------------
-- Table structure for hjmallind_topic_type
-- ----------------------------
DROP TABLE IF EXISTS `hjmallind_topic_type`;
CREATE TABLE `hjmallind_topic_type` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL,
  `sort` int(11) DEFAULT NULL,
  `is_delete` smallint(6) DEFAULT NULL,
  `store_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

