  `account_password` varchar(255) NOT NULL DEFAULT '' COMMENT '账套账号密码 <account模式下必须>',
  `account_number` varchar(255) NOT NULL DEFAULT '' COMMENT '账套编号 <account模式下必须>',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `id` (`id`) USING BTREE
